import './App.css';
import Login from './components/Login'
import { Routes, Route } from 'react-router-dom'
import Home from './components/Home';


function App() {
  return (
    <div className="App">



        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>      
      <Login />



    </div>
  );
}

export default App;
